import React from 'react';
import PropTypes from 'prop-types';


class App extends React.Component {

  constructor(props) {
    super(props);
    console.log('HI');
  }


  state = {
    count:0
  };

  add = () => {
    this.setState(current => ({count: current.count + 1}));
  }

  minus = () => {
    this.setState(current => ({count: current.count - 1}));
  }

  render() {
    return <div>
      <h1>Current number: {this.state.count}</h1>

    </div>
  }
}

export default App;
